import "./Dialogs.css";
import Slider from "./Slider/Slider";
import Chat from "./Chat/Chat";
import styles from "./Slider/Slider.module.css";

const Dialog = () => {
    return (
        <div className="app-dialog">
            <Slider />
                <div className={styles.line}>
                </div>
            <Chat />
        </div>
    );
}

export default Dialog;
